                           BTN.classList.add('price-range-btn')
                           BTN.dataset.min = item.min
                           BTN.dataset.max = item.max
                           BTN.innerText = symbol+item.min.toLocaleString(ISO_lang)+' - '+symbol+item.max.toLocaleString(ISO_lang)
